column53:
Acivico Limited and its subsidiaries is a private limited company wholly owned by Birmingham City Council. The Group (including Acivico Limited Company) currently consists of Acivico (Building Consultancy) Limited and (Design, Construction and Facilities Management) and Acivico Traded Services. Collectively and individually, the companies are referred to as Acivico.
      
      The contract will be for three years commencing 1 April 2022 (2022/23). The contract is subject to satisfactory performance.
      
      The internal audit services required will include, but not limited to:
      1. Prepare, agree and undertake an audit plan (scope of services) for Acivico Limited and its subsidiaries;
      2. Present an overall annual assurance opinion to Management and Audit Committee;
      3. Be available to present their audit plan, audit findings and opinion to Management and Audit Committee;
      4. Attend Management and Audit Committee meetings if requested to do so during the year; 
      5. Provision of consultancy services as agreed with Management or Audit Committee including relevant sector and industry advice; 
      6. Sufficient knowledge to evaluate the risk of fraud; and
      7. Perform the duties of an Internal Auditor in accordance with the Chartered Institute of Internal Auditors and other relevant legislation keeping up to date with any changes to legislation and accounting practices.
      
      Acivico will be using its free to use e-tendering system (in-tend) for the administration of this procurement process and potential suppliers must register with the system to be able to express an interest. If you wish to express an interest in this opportunity please click on the following link to access https://in-tendhost.co.uk/birminghamcc/ and submit your details to register. You will then be sent details on how to log on which will enable you to download all relevant quotation documentation.  
      
      If you are unable to register with In-tend or have any questions or problems on how to use this web site please either email us at: cps@birmingham.gov.uk 
      
      Your completed quotation submission should be returned by noon on 15th December 2021 via the 'in-tend' system https://in-tendhost.co.uk/birminghamcc
